import axios from '../../AXIOS_CONFIG/Axios'

export const getContests = () => {
	return async (dispatch) => {
		try {
			const response = await axios.get('/contests')			
			console.log("CONTESTS response", response.status)

		}catch(error){
			throw new Error(error.message)
		}
	}
}
